use crypto_api::cipher::CipherInfo;
use crypto_api_libsodium::{ LibsodiumError, Ciphers };


/// A helper macro to compare a `Box<dyn Error + 'static>` to a `LibsodiumError`
macro_rules! compare_err {
	($err:expr, $expected:expr) => (
		assert_eq!(*$err.downcast_ref::<LibsodiumError>().unwrap(), $expected)
	);
}


/// A trait to extend the info-structs with the ability to test them
trait PropertyTest {
	fn test(&self);
}
impl PropertyTest for CipherInfo {
	fn test(&self) {
		// Create cipher
		let cipher = Ciphers::from_name(self.name).unwrap().cipher();
		
		// Test against `info()`
		assert_eq!(*self, cipher.info());
		
		// Test buffer lengths...
		let aead_len = self.aead_tag_len.unwrap_or(0);
		
		// ...for encryption
		let err = cipher.encrypt(
			&mut vec![0; aead_len], 1,
			&vec![0; self.key_len], &vec![0u8; self.nonce_len]
		).unwrap_err();
		compare_err!(err, LibsodiumError::ApiMisuse("Buffer is too small"));
		
		// ...for decryption
		let err = cipher.decrypt(
			&mut vec![0; aead_len], aead_len + 1,
			&vec![0; self.key_len], &vec![0u8; self.nonce_len]
		).unwrap_err();
		compare_err!(err, LibsodiumError::ApiMisuse("Buffer is too small"));
	}
}


/// A test vector to test a cipher
struct CipherTestVector {
	pub name: &'static str,
	
	pub key: &'static[u8],
	pub nonce: &'static[u8],
	pub plaintext: &'static[u8],
	pub ad: &'static[u8],
	pub ciphertext: &'static[u8]
}
impl CipherTestVector {
	pub fn test(&self) {
		match self.ad.len() {
			0 => self.test_cipher(),
			_ => self.test_aead_cipher()
		}
	}
	
	fn test_cipher(&self) {
		// Create cipher and test if cipher is available
		let cipher = Ciphers::from_name(self.name).unwrap().cipher();
		
		// Create the buffer
		let mut buf = self.plaintext.to_vec();
		buf.resize(self.ciphertext.len(), 0);
		
		// Test encryption
		let ciphertext_len = cipher.encrypt(
			&mut buf, self.plaintext.len(),
			self.key, self.nonce
		).unwrap();
		assert_eq!(&buf[..ciphertext_len], self.ciphertext);
		
		// Test decryption
		let plaintext_len = cipher.decrypt(
			&mut buf, ciphertext_len,
			self.key, self.nonce
		).unwrap();
		assert_eq!(&buf[..plaintext_len], self.plaintext);
	}
	fn test_aead_cipher(&self) {
		// Create cipher and test if cipher is available
		let cipher = Ciphers::from_name(self.name).unwrap().aead_cipher().unwrap();
		
		// Create the buffer
		let mut buf = self.plaintext.to_vec();
		buf.resize(self.ciphertext.len(), 0);
		
		// Test encryption
		let ciphertext_len = cipher.seal(
			&mut buf, self.plaintext.len(), self.ad,
			self.key, self.nonce
		).unwrap();
		assert_eq!(&buf[..ciphertext_len], self.ciphertext);
		
		// Test decryption
		let plaintext_len = cipher.open(
			&mut buf, ciphertext_len, self.ad,
			self.key, self.nonce
		).unwrap();
		assert_eq!(&buf[..plaintext_len], self.plaintext);
	}
}


/// A test vector to test an AEAD cipher
struct AeadErrorTestVector {
	pub name: &'static str,
	
	pub key: &'static[u8],
	pub nonce: &'static[u8],
	pub ciphertext: &'static[u8],
	pub ad: &'static[u8]
}
impl AeadErrorTestVector {
	pub fn test(&self) {
		// Create cipher and test if cipher is available and if the cipher is an AEAD cipher
		let cipher = Ciphers::from_name(self.name).unwrap().aead_cipher().unwrap();
		
		// Try to decrypt the data
		let err = cipher.open(
			&mut self.ciphertext.to_vec(), self.ciphertext.len(), &self.ad,
			self.key, self.nonce
		).unwrap_err();
		compare_err!(err, LibsodiumError::InvalidData);
	}
}


